window.bookSummaryJSON = "<p>From <i>USA Today</i> best-selling author, Willow Winters, comes a sexy office romance with a brooding hero you can't help but fall head over heels for...in and out of the boardroom.</p> <p>I didn’t get to where I am by being nice. <br> I’m the boss, the CEO, the owner of whatever I want. <br> Right now, that includes every person in this building of the company I just bought. <br> I stop at nothing once I’ve decided I’m taking something. </p> <p>And then she showed up...full of spitfire just for me, the man she's decided is her worst enemy. <br> Like I said, I stop at nothing once I’ve decided I’m taking something. <br> This pretty little thing just moved to the top of my \"must acquire\" list.</p>"; 
